#define FONT_CALCULATE_ADVANCE( cinfo ) ((-cinfo->left + cinfo->advanceX)+1)

void font_create( font_t * font )
{
}

void font_load_embedded( font_t * font, const unsigned char * data, int dataSize )
{
    int numChars;
    int bpp;
    int loop;
    int imageSize;
    char ident[5];
    unsigned char * pixels;

    bitstream_t s;
    font_charinfo_t * cinfo;

	GLenum e;

    // setup the input stream here
    bitstream_set( &s, (char*)data, dataSize );

    // read identity
    bitstream_read( &s, ident, 4 );
    ident[4] = '\0';

    if ( ident[0] != 'D' || ident[1] != 'F' || ident[2] != 'O' || ident[3] != 'N' )
        return;

    // read num chars
    bitstream_read( &s, &numChars, 4 );

    // read character data
    for( loop = 32; loop < numChars; ++loop )
    {
        cinfo = &font->char_info[ (loop-32) ];
        bitstream_read( &s, &cinfo->advanceX, 4 );
        bitstream_read( &s, &cinfo->advanceY, 4 );
        bitstream_read( &s, &cinfo->glyphIndex, 4 );
        bitstream_read( &s, &cinfo->hBearingX, 4 );
        bitstream_read( &s, &cinfo->hBearingY, 4 );
        bitstream_read( &s, &cinfo->height, 4 );
        bitstream_read( &s, &cinfo->left, 4 );
        bitstream_read( &s, &cinfo->top, 4 );
        bitstream_read( &s, &cinfo->vBearingX, 4 );
        bitstream_read( &s, &cinfo->vBearingY, 4 );
        bitstream_read( &s, &cinfo->width, 4 );
        bitstream_read( &s, &cinfo->uv, 16 );
    }

    // read image data
    bitstream_read( &s, &font->textureWidth, 4 );
    bitstream_read( &s, &font->textureHeight, 4 );
    bitstream_read( &s, &bpp, 4 );

    imageSize = (font->textureWidth*font->textureHeight*bpp);
    pixels = (unsigned char*)malloc( imageSize );
    bitstream_read( &s, pixels, imageSize );

#if USEGL

    glGenTextures( 1, &font->textureID );

    glBindTexture( GL_TEXTURE_2D, font->textureID );

    glTexParameteri( GL_TEXTURE_2D, GL_TEXTURE_MAG_FILTER, GL_NEAREST );
    glTexParameteri( GL_TEXTURE_2D, GL_TEXTURE_MIN_FILTER, GL_NEAREST );

    e = glGetError();
    glTexImage2D( GL_TEXTURE_2D, 0, GL_RGBA, font->textureWidth, font->textureHeight, 0, GL_BGRA_EXT, GL_UNSIGNED_BYTE, pixels );
    e = glGetError();

    if ( e != GL_NO_ERROR )
    {
        printf( "Error uploading image: %i\n", e );
    }
#endif

    free( pixels );
} // font_load_embedded

void font_draw( font_t * font, int x, int y, const char * str, unsigned char r, unsigned char g, unsigned char b, unsigned char a )
{
    int loop;
    int numChars = strlen( str );
    float penX = x;
    float penY = y;
    int charwidth;
    int charheight;
    float xoffset;
    float yoffset;
    float zdepth = 0.1f;
    font_charinfo_t * c, *prev;


#if USEGL
    glEnable( GL_TEXTURE_2D );
    glBindTexture( GL_TEXTURE_2D, font->textureID );
    glEnable( GL_BLEND );
    glBlendFunc( GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA );
    glColor4ub( r, g, b, a );
    glBegin( GL_TRIANGLES );
#endif

    for( loop = 0; loop < numChars; ++loop )
    {
        c = font_get_character( font, str[loop] );

        if ( !c )
            continue;

        if ( loop > 0 )
        {
            prev = font_get_character( font, str[ loop-1 ] );
        }

        charwidth = c->width;
        charheight = c->height;
        xoffset = c->left - c->hBearingX;
        yoffset = -c->top;

#if USEGL
        // upper left
        glTexCoord2f(c->uv[0], c->uv[1]);
        glVertex3f( xoffset+penX, penY + yoffset, zdepth );

        // lower left
        glTexCoord2f(c->uv[0], c->uv[3]);
        glVertex3f( xoffset+penX, penY + charheight + yoffset, zdepth );

        // lower right
        glTexCoord2f(c->uv[2], c->uv[3]);
        glVertex3f( xoffset+penX+charwidth, penY + charheight + yoffset, zdepth );

        // lower right
        glTexCoord2f(c->uv[2], c->uv[3]);
        glVertex3f( xoffset+penX+charwidth, penY + charheight + yoffset, zdepth );

        // upper right
        glTexCoord2f(c->uv[2], c->uv[1]);
        glVertex3f( xoffset+penX+charwidth, penY + yoffset, zdepth );

        // upper left
        glTexCoord2f(c->uv[0], c->uv[1]);
        glVertex3f( xoffset+penX, penY + yoffset, zdepth );
#endif
        //penX += (-c->left + c->advanceX) + 1;
		penX += FONT_CALCULATE_ADVANCE(c);
    }

#if USEGL
    glEnd();
    glBindTexture( GL_TEXTURE_2D, 0 );
    glDisable( GL_TEXTURE_2D );
    glDisable( GL_BLEND );
#endif
}

void font_destroy( font_t * font )
{
    // delete texture (OpenGL)
	glDeleteTextures( 1, &font->textureID );
}

font_charinfo_t * font_get_character( font_t * font, font_char_t c )
{
    return &font->char_info[ (c-32) ];
} // font_get_character

int font_string_width( font_t * font, const char * str )
{
	int width;
	int i;
	int string_len;
	font_charinfo_t * charinfo;

	string_len = strlen(str);


	width = 0;
	for( i = 0; i < string_len; ++i )
	{
		charinfo = &font->char_info[ (str[i-32]) ];
		width += FONT_CALCULATE_ADVANCE(charinfo);
	}

	return width;
}



